import React from 'react';

import { NavLink } from 'react-router-dom';

const ErrorPage = () => {
  return (
    <div id='notfound'>
      <div className='notfound'>
        <div className='notfound-404'>
          <h1>Oops!</h1>
          <h2>404 - The Page cannot be found</h2>
        </div>

        <NavLink to='/'>Go to Home</NavLink>
      </div>
    </div>
  );
};

export default ErrorPage;
